CREATE TABLE `ocr_jobs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `church_id` int(11) NOT NULL,
  `filename` varchar(255) NOT NULL,
  `original_filename` varchar(255) DEFAULT NULL,
  `file_path` varchar(500) DEFAULT NULL,
  `file_size` int(11) DEFAULT NULL,
  `mime_type` varchar(100) DEFAULT NULL,
  `status` enum('pending','processing','complete','error','cancelled') DEFAULT 'pending',
  `record_type` enum('baptism','marriage','funeral','custom') NOT NULL,
  `language` char(2) DEFAULT 'en',
  `confidence_score` decimal(5,2) DEFAULT NULL,
  `error_regions` text DEFAULT NULL,
  `error_message` text DEFAULT NULL,
  `ocr_result` longtext DEFAULT NULL,
  `metadata` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`metadata`)),
  `processing_started_at` timestamp NULL DEFAULT NULL,
  `processing_completed_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `description` text DEFAULT NULL,
  `processing_log` text DEFAULT NULL,
  `ocr_result_translation` longtext DEFAULT NULL COMMENT 'Translated OCR result text',
  `translation_confidence` decimal(3,2) DEFAULT NULL COMMENT 'Translation confidence score 0.00-1.00',
  `extracted_entities` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Extracted entities from AI processing' CHECK (json_valid(`extracted_entities`)),
  `entity_confidence` decimal(3,2) DEFAULT NULL COMMENT 'Entity extraction confidence score 0.00-1.00',
  `needs_review` tinyint(1) DEFAULT 1 COMMENT 'Whether the OCR result needs manual review',
  `detected_language` varchar(10) DEFAULT NULL COMMENT 'Detected language code',
  `preprocessing_options` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`preprocessing_options`)),
  `raw_response_json` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`raw_response_json`)),
  `attempts` int(11) DEFAULT 0,
  `processed_image_path` text DEFAULT NULL,
  `approved` tinyint(1) DEFAULT 0,
  `segments_json` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`segments_json`)),
  PRIMARY KEY (`id`),
  KEY `idx_church_status` (`church_id`,`status`),
  KEY `idx_record_type` (`record_type`),
  KEY `idx_created_at` (`created_at`),
  KEY `idx_ocr_jobs_status_confidence` (`status`,`confidence_score`),
  KEY `idx_ocr_jobs_approved` (`approved`,`created_at`),
  KEY `idx_ocr_jobs_attempts` (`attempts`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
